import React from 'react';
import './Home.css';
import cafeImage from '../assets/cafe.jpeg';
import coffeeImage from '../assets/coffee.jpeg';
import bakeryImage from '../assets/bakery.jpeg';
import foodImage from '../assets/food.jpeg';
import peopleImage from '../assets/people.jpeg';

const Home = () => {
  return (
    <div id="home" className="home">
      {/* Content Section */}
      <div className="home-content">
        <h1>Welcome to Food Hall Cafe</h1>
        <p>Experience the perfect blend of comfort, taste, and ambiance. Join us for an unforgettable coffee experience!</p>
      </div>

      {/* Sliding Image Section */}
      <div className="image-slider">
        <div className="slider-track">
          <img src={cafeImage} alt="Cafe Front" className="slider-image" />
          <img src={coffeeImage} alt="Coffee Cup" className="slider-image" />
          <img src={bakeryImage} alt="Bakery Items" className="slider-image" />
          <img src={foodImage} alt="Delicious Food" className="slider-image" />
          <img src={peopleImage} alt="People Around" className="slider-image" />
        </div>
      </div>
    </div>
  );
};

export default Home;
